import React from "react";
import {Link} from "react-router-dom";
import data from "../data";
import {Button} from "../../Templates/js/bootstrap.esm";

function ArrayMainScreen(props) {

    return (
        <div className="algorithms">
            <p>Select an algorithm you want to see!</p>
            <ul>
            {
                data.algorithms.map(algorithm =>
                        <li key={algorithm._id}>
                            <Button className="btn btn-primary" data-toggle="colapse" data-target="#collapseE">
                                Work
                            </Button>
                        </li>)

            }
            </ul>
        </div>

    )
}

export default ArrayMainScreen;
